// SPDX-License-Identifier: MIT
pragma solidity 0.8.30;

contract DAOVotationSystem {
    // --- Owner manual ---
    address public owner;
    modifier onlyOwner() { require(msg.sender == owner, "not owner"); _; }

    constructor() {
        owner = msg.sender;
    }

    // --- Eventos ---
    event NewProposal(uint indexed id, address indexed creator, string description, uint256 deadline);
    event Vote(address indexed voter, uint indexed proposalId, bool positive, uint256 weight);
    event Closed(uint indexed proposalId, bool passed, uint256 positiveVotesWeight, uint256 negativeVotesWeight);

    uint256 private _proposalCount;

    struct Proposal {
        uint id;
        address creator;
        string description;
        uint256 positiveVotes;        // no ponderado
        uint256 positiveVotesWeight;  // ponderado
        uint256 negativeVotes;
        uint256 negativeVotesWeight;
        bool isActive;
        uint256 deadline;             // timestamp limite
        mapping(address => bool) hasVoted;
    }

    mapping(uint => Proposal) private _proposals;
    mapping(address => uint256) public voteWeight;

    // --------- ADMIN ---------
    function setVoteWeight(address voter, uint256 weight) external onlyOwner {
        voteWeight[voter] = weight;
    }

    // Crea una propuesta con ventana en segundos
    function newProposal(address creator, string calldata description, uint256 durationSeconds) external onlyOwner {
        require(bytes(description).length > 0, "Empty description");
        require(durationSeconds > 0, "Bad duration");

        uint256 id = _proposalCount++;
        Proposal storage p = _proposals[id];
        p.id = id;
        p.creator = creator;
        p.description = description;
        p.isActive = true;
        p.deadline = block.timestamp + durationSeconds;

        emit NewProposal(id, creator, description, p.deadline);
    }

    // --------- VOTO ---------
    function vote(uint proposalId, bool positive) external {
        require(proposalId < _proposalCount, "Invalid proposal");
        Proposal storage p = _proposals[proposalId];
        require(p.isActive, "Proposal not active");
        require(block.timestamp < p.deadline, "Proposal expired");
        require(!p.hasVoted[msg.sender], "Already voted");

        uint256 weight = voteWeight[msg.sender];
        require(weight >= 1, "No vote weight");

        p.hasVoted[msg.sender] = true;

        if (positive) {
            unchecked { p.positiveVotes++; }
            p.positiveVotesWeight += weight;
        } else {
            unchecked { p.negativeVotes++; }
            p.negativeVotesWeight += weight;
        }

        emit Vote(msg.sender, proposalId, positive, weight);
    }

    // --------- CIERRE/LECTURA ---------
    function closeProposal(uint proposalId) external onlyOwner {
        require(proposalId < _proposalCount, "Invalid proposal");
        Proposal storage p = _proposals[proposalId];
        require(p.isActive, "Already closed");
        require(block.timestamp >= p.deadline, "Still active");
        p.isActive = false;

        bool passed = p.positiveVotesWeight > p.negativeVotesWeight;
        emit Closed(proposalId, passed, p.positiveVotesWeight, p.negativeVotesWeight);
    }

    function proposalInfo(uint proposalId)
        external
        view
        returns (
            uint id,
            address creator,
            string memory description,
            bool isActive,
            uint256 deadline,
            uint256 positiveVotes,
            uint256 positiveVotesWeight,
            uint256 negativeVotes,
            uint256 negativeVotesWeight
        )
    {
        require(proposalId < _proposalCount, "Invalid proposal");
        Proposal storage p = _proposals[proposalId];
        id = p.id;
        creator = p.creator;
        description = p.description;
        isActive = p.isActive;
        deadline = p.deadline;
        positiveVotes = p.positiveVotes;
        positiveVotesWeight = p.positiveVotesWeight;
        negativeVotes = p.negativeVotes;
        negativeVotesWeight = p.negativeVotesWeight;
    }

    function proposalsCount() external view returns (uint256) {
        return _proposalCount;
    }

    function hasVoted(uint proposalId, address voter) external view returns (bool) {
        require(proposalId < _proposalCount, "Invalid proposal");
        return _proposals[proposalId].hasVoted[voter];
    }
}

